import { Container, Table } from "react-bootstrap";
import "../../Assets/CitasMedico.css";
import { Link, useParams } from "react-router-dom";


export default class SalaEspera extends Component {
  render() {
    return (
      <div className='SalaEspera'>
        <table>
          <thead>
              <tr>
                <th>TURNO</th>
                <th>SALA CONSULTA</th>
              </tr>
          </thead>
          <tbody>
              <tr>
                <td>AT228</td>
                <td>2</td>
              </tr>
          </tbody>
        </table>
      
      
      
      </div>
    )
  }
}
